import React from "react";
import "./user.css"

const User = () => {


    async function getdatad() {
        try {
            const response = await fetch('http://localhost:6000/user');
            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }
            const data = await response.json();
            console.log(data);
            return data;
        } catch (error) {
            console.error('This is an error:', error);
            throw error; // Re-throw error if further handling is needed
        }
    }
    
    getdatad()
        .then((data) => console.log('Fetched Data:', data))
        .catch((error) => console.error('Error in fetching data:', error));
    
    console.log(getdatad())
  return (
    <>
      <div className="container" id="tablealign">
        <div className="row">
          <div className="col-sm 12">
            <table class="table">
              <thead>
                <tr >
                  <th scope="col">id</th>
                  <th scope="col">Name</th>
                  <th scope="col">Email</th>
                  <th scope="col">Type</th>
                  <th scope="col">time</th>
                </tr>
              </thead>
              <tbody>
                <tr >
                  <th scope="row">1</th>
                  <td className="border">Mark</td>
                  <td className="border">Otto</td>
                  <td className="border">@mdo</td>
                  <td className="border">@akhielsh</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </>
  );
};

export default User;
